import { ApiData } from "../Api/Data";
import { GET_ALL } from "./action";
const initialState = {};

ApiData.then((a) => {
  initialState = a;
});

export const addReducer = (state = initialState, action) => {
  switch (action.type) {
    case GET_ALL:
      return {
        state,
      };
  }
};
